The plugin Row Columns creates a custom render for CSV files to show its conent in columns. └── render ├── src │ ├── lib │ │ ├── row.columns.api.ts │ │ └── row.columns.api.ts │ └── public-api.ts ├── ng-package.json ├── package.json ├── tsconfig.json ├── tsconfig.spec.json └── tslint.json row.columns.api.ts row.columns.ts public_api.ts import * as Toolkit from 'chipmunk.client.toolkit';
// Delimiter for CSV files.
export const CDelimiters = [';', ',', '\t'];
// For now chipmunk supports only predefined count of columns. Developer cannot change // it dynamically. Here we are defining some columns headers
export const CColumnsHeaders = [ 'A', 'B', 'C', 'D', 'F', 'G', 'H', 'I', 'J', 'K',
];
let delimiter: string | undefined;
/** * @class ColumnsAPI * @description Implementation of custom row's render, based on TypedRowRenderAPIColumns */
export class ColumnsAPI extends Toolkit.TypedRowRenderAPIColumns { constructor() { super(); } /** * Returns list of column's headers * @returns { string[] } - column's headers */ public getHeaders(): string[] { return CColumnsHeaders; } /** * Should returns parsed row value as array of columns. Length of columns here * should be equal to length of columns (see getHeaders) * @param str { string } - string value of row * @returns { string[] } - values of columns for row */ public getColumns(str: string): string[] { const columns: string[] = str.split(this._getDelimiter(str)); // Because we don't know, how much columns file will have, we are adding missed // or removing no needed columns if (columns.length &lt; CColumnsHeaders.length) { for (let i = CColumnsHeaders.length - columns.length; i &gt;= 0; i += 1) { columns.push('-'); } } else if (columns.length &gt; CColumnsHeaders.length) { const rest: string[] = columns.slice(CColumnsHeaders.length - 2, columns.length); columns.push(rest.join(this._getDelimiter(str))); } return columns; } /** * This method will be called by chipmunk's core once before render column's headers. * @returns { Array&lt;{ width: number, min: number }&gt; } - default width and minimal width for * each column */ public getDefaultWidths(): Array&lt;{ width: number, min: number }&gt; { return [ { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, { width: 50, min: 30 }, ]; } private _getDelimiter(input: string): string { if (delimiter !== undefined) { return delimiter; } else { let score: number = 0; CDelimiters.forEach((del: string) =&gt; { let length = input.split(del).length; if (length &gt; score) { score = length; delimiter = del; } }); } return delimiter; }
} import * as Toolkit from 'chipmunk.client.toolkit';
import { ColumnsAPI } from './row.columns.api';
/** * @class Columns * @description Chipmunk supports custom renders for rows. It means, before row * (in main view and view of search result) will be show, chipmunk will apply * available custom renders. Render could be bound with type of income data. * For example with type of opened file. * To bind render with type of income data developer should use abstract class * TypedRowRender. As generic class, developer should provide render, which * should be used for such data. * In this example we are using predefined render of columns */
export class Columns extends Toolkit.TypedRowRender { // Store instance of custom render to avoid recreating of it with each new // chipmunk's core request private _api: ColumnsAPI = new ColumnsAPI(); constructor() { super(); } /** * This method will be called by chipmunk to detect, which kind of render we are * going to use. * @returns { ETypedRowRenders } - tells chipmunk's core, which kind of render will be used */ public getType(): Toolkit.ETypedRowRenders { // We will use columns render. return Toolkit.ETypedRowRenders.columns; } /** * This method will be called for each row in main view and view of search results * @param sourceName { string } - name of source of incoming data. For example for file * it will be filename. For plugin - plugin name. * @param sourceMeta { string } - optional data, which could better describe incoming data. * For example for text file it will be "plain/text"; for DLT file - "dlt" * @returns { boolean } - in "true" custom render will be applied for row; in "false" custom * render will be ignored */ public isTypeMatch(sourceName: string, sourceMeta?: string): boolean { // In this example, we are creating custom render for CSV file, to show its content // as columns. // So, let's just check file name for expected extension. return sourceName.search(/\.csv$/gi) !== -1; } /** * Caller for API of custom render. Would be called by chipmunk's core for each row, which returns * "true" via "isTypeMatch" * @returns { Class } */ public getAPI(): ColumnsAPI { return this._api; }
} /* * Public API Surface of terminal */
import { Columns } from './lib/row.columns';
const columns = new Columns();
// For Angular based plugin would be enough to make export with instance of
// render. No needs to use gateway
export { columns };

