The plugin Plugin with Settings gives the opportunity to create custom settings for plugins. At the top there is an input area to search for specific settings quickly. On the left side are the sections of the settings. To create settings the first step is to create the component for the setting. In this example SomestringSetting will create an input field which takes a string in. Currently there are 3 types of settings available to implement: string input, number input and checkboxes The validate method to checks the value of the setting and only saves if it is valid. The Service class is necessary to register the created settings and make them accessable. The setup registers the created settings with: key - Keyname of setting (necessary to define subsettings) path - Keyname of supersetting (under which section the settings should be put) name - Title of setting (e.g. title of input) desc - Description under setting type - Type of setting (standard - show settings, advanced - button to show/hide advanced settings) By creating a read method the value of the setting can be read and put out into the console. It's important to note, that the get method needs the data type of the setting and takes the relative path of the setting (e.g. 'selectionparser' ) and the full path (all superpathes seperated by a '.') as the second arguement (e.g. 'plugins.selectionparser' ). Settings can be created for both the UI part or the process part of the plugin. Settings for the UI part are located in the render folder, whereas the settings for the process part are located in the process folder. NOTE: Settings can only be added under Plugins NOTE: No restriction on amount of sub-settings └── process ├── src │ └── main.ts ├── package.json └── tsconfig.json
└── render ├── src │ └── index.ts ├── package.json ├── tsconfig.json ├── tslint.json └── webpack.config.js main.ts index.ts import PluginIPCService, { ServiceState, ServiceSettings, Entry, ESettingType, IPCMessages, Field, ElementInputStringRef } from 'chipmunk.plugin.ipc';
