export class SomestringSetting extends Field { /** * We should define reference to one of controller to render setting: */ private _element: ElementInputStringRef = new ElementInputStringRef({ placeholder: 'Test placeholder', }); /** * Returns default value */ public getDefault(): Promise { return new Promise((resolve) =&gt; { resolve(''); }); } /** * Validation of value. Called each time user change it. Also called before save data into * setting file. * Should reject on error and resolve on success. */ public validate(state: string): Promise { return new Promise((resolve, reject) =&gt; { if (typeof state !== 'string') { return reject(new Error(`Expecting string type for "SomestringSetting"`)); } if (state.trim() !== '' &amp;&amp; (state.length &lt; 3 || state.length &gt; 10)) { return reject(new Error(`${state.length} isn't valid length. Expected 3 &lt; &gt; 10`)); } resolve(); }); } /** * Should return reference to render component */ public getElement(): ElementInputStringRef { return this._element; }
