}
// To delivery plugin into chipmunk we should use chipmunk's gateway
// It's stored in global variable "chipmunk"
// Gateway has a method "setPluginExports". With this method we can
// define a list of exported parsers.
const gate: Toolkit.PluginServiceGate | undefined = (window as any).chipmunk;
if (gate === undefined) { // This situation isn't possible, but let's check it also console.error(`Fail to find chipmunk gate.`);
} else { gate.setPluginExports({ // Name of property (in this case it's "datetime" could be any. Chipmunk doesn't check // a name of property, but detecting a parent class. datetime: new SelectionParser(), // Share service with chipmunk service: new Service(), });
