API Chipmunk provides an API for the UI , which gives access to major core events, UI of the core and plugin IPC (required for communication beteween the host and render of plugin). The API for the UI is named chipmunk.client.toollkit and holds different modules. NOTE: This API will soon be deprecated 1. How to use the API Method 1: Bind the api to the component One way to use the API is by binding it to the main component of the plugin (component.ts). IMPORTANT : When the API is bound to component directly, the API is bound to the life cycle of the component and gets destroyed together with the component. It is advised to bind the API to the component if it is going to be used locally only by the component itself and nothing else. If the API should be used globally (in scope of the plugin), the second method is more suited. The example code below shows an example plugin with the API bound to it. The example also includes three methods that are being called upon specific events from the sessions/tabs. To demonstrate how to use the API, each time the session changes the session ID will be printed out in the console. template.html styles.less component.ts module.ts public_api.ts &lt;p&gt;Example&lt;/p&gt; p { color: #FFFFFF;
