export * from './module'; 3. Abstract classes chipmunk.client.toolkit provides different kinds of abstract classes from which classes can extend from. 3.1 Parsers These abstract classes allow to create parsers that can modify the output in the rows (e.g: change text color, convert into different format). Parser name Description RowBoundParser Parse only data received from the process part of the plugin RowCommomParser Parse data from any kind of source RowTypedParser Parse only specific type of source (e.g. DLT) SelectionParser (coming soon) Parse only selected line(s), right-click to see self-chosen name as option to see the parsed result in the tab Details below TypedRowRender (coming soon) Parser for more complex stream output TypedRowRenderAPIColumns - show stream line as columns TypedRowRenderAPIExternal - use custom Angular component as stream RowBoundParser // Typescript /** * Allows creating row parser, which will bound with plugin's host. * It means: this row parser will be applied only to data, which was * received from plugin's host. * It also means: usage of this kind of plugin makes sense only if plugin has * host part (backend part), which delivery some data. A good example would be: * serial port plugin. Host part extracts data from serial port and sends into * stream; render (this kind of plugin) applies only to data, which were gotten * from serial port. * @usecases decoding stream output content; converting stream output into human-readable format * @requirements TypeScript or JavaScript * @examples Base64string parser, HEX converting into a string and so on * @class RowBoundParser */
export declare abstract class RowBoundParser { /** * This method will be called with each line in stream was gotten from plugin's host * @param {string} str - single line from stream (comes only from plugin's host) * @param {EThemeType} themeTypeRef - reference to active theme (dark, light and so on) * @param {IRowInfo} row - information about current row (see IRowInfo for more details) * @returns {string} method should return a string. */ abstract parse(str: string, themeTypeRef: EThemeType, row: IRowInfo): string;
} Example - RowBoundParser index.ts import * as Toolkit from 'chipmunk.client.toolkit'; // Import UI API to extend Parser class
class ParseMe extends Toolkit.RowBoundParser { // Extend parser class with Abstract parser class public parse(str: string, themeTypeRef: Toolkit.EThemeType, row: Toolkit.IRowInfo): string { // Create parser which modifies and returns parsed string return `--&gt; ${str}`; // Return string with --&gt; in front }
} const gate: Toolkit.PluginServiceGate | undefined = (window as any).logviewer; // Identification of the plugin
if (gate === undefined) { // If binding didn't work print out error message console.error(`Fail to find logviewer gate.`);
} else { gate.setPluginExports({ // Set parser(s) to export here (Setting Multiple parsers possible) parser: new ParseMe() // Create parser instance (Free to choose parser name) });
} RowCommomParser // Typescript /** * Allows creating row parser, which will be applied to each new line in stream. * @usecases decoding stream output content; converting stream output into human-readable format * @requirements TypeScript or JavaScript * @examples Base64string parser, HEX converting into a string and so on * @class RowCommonParser */
export declare abstract class RowCommonParser { /** * This method will be called with each line in stream * @param {string} str - single line from stream * @param {EThemeType} themeTypeRef - reference to active theme (dark, light and so on) * @param {IRowInfo} row - information about current row (see IRowInfo for more details) * @returns {string} method should return a string. */ abstract parse(str: string, themeTypeRef: EThemeType, row: IRowInfo): string;
} Example - RowCommonParser index.ts import * as Toolkit from 'chipmunk.client.toolkit'; // Import UI API to extend Parser class
class ParseMe extends Toolkit.RowCommonParser { // Extend parser class with Abstract parser class public parse(str: string, themeTypeRef: Toolkit.EThemeType, row: Toolkit.IRowInfo): string { // Create parser which modifies and returns parsed string return `--&gt; ${str}`; // Return string with --&gt; in front }
} const gate: Toolkit.PluginServiceGate | undefined = (window as any).logviewer; // Identification of the plugin
if (gate === undefined) { // If binding didn't work print out error message console.error(`Fail to find logviewer gate.`);
} else { gate.setPluginExports({ // Set parser(s) to export here (Setting Multiple parsers possible) parser: new ParseMe() // Create parser instance (Free to choose parser name) });
} RowTypedParser // Typescript /** * Allows creating row parser with checking the type of source before. * It means this parser could be bound with some specific type of source, * for example with some specific file's type (DLT, log and so on) * @usecases decoding stream output content; converting stream output into human-readable format * @requirements TypeScript or JavaScript * @examples Base64string parser, HEX converting into a string and so on * @class RowTypedParser */
export declare abstract class RowTypedParser { /** * This method will be called with each line in stream * @param {string} str - single line from stream * @param {EThemeType} themeTypeRef - reference to active theme (dark, light and so on) * @param {IRowInfo} row - information about current row (see IRowInfo for more details) * @returns {string} method should return a string. */ abstract parse(str: string, themeTypeRef: EThemeType, row: IRowInfo): string; /** * This method will be called for each line of stream before method "parse" will be called. * @param {string} sourceName - name of source * @returns {boolean} - true - method "parse" will be called for this line; false - parser will be ignored */ abstract isTypeMatch(sourceName: string): boolean;
} Example - RowTypedParser index.ts import * as Toolkit from 'chipmunk.client.toolkit'; // Import UI API to extend Parser class
class ParseMe extends Toolkit.RowTypedParser { // Extend parser class with Abstract parser class public parse(str: string, themeTypeRef: Toolkit.EThemeType, row: Toolkit.IRowInfo): string { // Create parser which modifies and returns parsed string return `--&gt; ${str}`; // Return string with --&gt; in front } public isTypeMatch(fileName: string): boolean { // Typecheck for each line of stream before parsing if (typeof fileName === 'string' &amp;&amp; fileName.search(/\.txt/) &gt; -1) { // Check if source is a .txt file return true; // Return true in case the it is a .txt file } }
}
const gate: Toolkit.PluginServiceGate | undefined = (window as any).logviewer; // Identification of the plugin
