export declare abstract class SelectionParser { /** * This method will be called on user selection * @param {string} str - selection in main view or search results view * @param {EThemeType} themeTypeRef - reference to active theme (dark, light and so on) * @returns {string} method should return a string or HTML string */ abstract parse(str: string, themeTypeRef: EThemeType): string | THTMLString; /** * Should return name of parser to be shown in context menu of selection * @param {string} str - selection in main view or search results view * @returns {string} name of parser */ abstract getParserName(str: string): string | undefined;
