} const gate: Toolkit.PluginServiceGate | undefined = (window as any).logviewer; // Identification of the plugin
if (gate === undefined) { // If binding didn't work print out error message console.error(`Fail to find logviewer gate.`);
} else { gate.setPluginExports({ // Set parser(s) to export here (Setting Multiple parsers possible) parser: new ParseMe() // Create parser instance (Free to choose parser name) });
} TypedRowRender // Typescript /** * This class is used for more complex renders of stream output. Like: * - TypedRowRenderAPIColumns - to show stream line as columns * - TypedRowRenderAPIExternal - to use custom Angular component as stream * line render * * @usecases to show content in columns; to have full HTML/LESS features for rendering * @class TypedRowRender */
export declare abstract class TypedRowRender<T> { /** * This method will be called for each line of a stream before method "parse" will be called. * @param {string} sourceName - name of source * @returns {boolean} - true - method "parse" will be called for this line; false - parser will be ignored */ abstract isTypeMatch(sourceName: string): boolean; /** * This method will return one of the supported types of custom renders: * - columns * - external * @returns {ETypedRowRenders} - type of custom render */ abstract getType(): ETypedRowRenders; /** * Should return an implementation of custom render. An instance of one of the next renders: * - TypedRowRenderAPIColumns * - TypedRowRenderAPIExternal */ abstract getAPI(): T;
